import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/logo.png";
import "../Layout.css";

function Navbar() {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src={logo} alt="Kumla Sportfiske" className="logo" />
      </div>

      <button className="hamburger" onClick={toggleMobileMenu}>
        ☰
      </button>

      <div className={`navbar-right ${mobileMenuOpen ? "mobile-active" : ""}`}>
        {/* Startsida */}
        <NavLink to="/" className="navlink" onClick={() => setMobileMenuOpen(false)}>Startsida</NavLink>

        {/* Regler Dropdown */}
        <div className="dropdown">
          <span className="navlink">Regler ▼</span>
          <div className="dropdown-content">
            <NavLink to="/rules?lake=Lugnet" onClick={() => setMobileMenuOpen(false)}>Lugnet</NavLink>
            <NavLink to="/rules?lake=Säbylundssjön" onClick={() => setMobileMenuOpen(false)}>Säbylundssjön</NavLink>
            <NavLink to="/rules?lake=Nolsjön" onClick={() => setMobileMenuOpen(false)}>Nolsjön</NavLink>
            <hr style={{ margin: "5px 0", borderColor: "#0077cc" }} />
            <NavLink to="/clubrules" onClick={() => setMobileMenuOpen(false)}>Klubbregler</NavLink>
          </div>
        </div>

        {/* Kontakt Dropdown */}
        <div className="dropdown">
          <span className="navlink">Kontakt ▼</span>
          <div className="dropdown-content">
            <NavLink to="/contact" onClick={() => setMobileMenuOpen(false)}>Allmän kontakt</NavLink>
            <NavLink to="/inspectors" onClick={() => setMobileMenuOpen(false)}>Tillsynsmän</NavLink>
            <NavLink to="/about" onClick={() => setMobileMenuOpen(false)}>Om oss</NavLink>
          </div>
        </div>

        {/* Övriga länkar */}
        <NavLink to="/news" className="navlink" onClick={() => setMobileMenuOpen(false)}>Nyheter</NavLink>
        <NavLink to="/gallery" className="navlink" onClick={() => setMobileMenuOpen(false)}>Galleri</NavLink>
        <a
          href="https://www.ifiske.se/fiske-sabylundssjon.htm"
          target="_blank"
          rel="noopener noreferrer"
          className="navlink"
          onClick={() => setMobileMenuOpen(false)}
        >
          iFiske
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
